import React from "react";
import { NavLink } from 'react-router-dom';
import Logo from '../../assets/img/navbar_logo.png'
import './Navbar.css' 

const Navbar = () =>{
    return(
        <div className="navbar">
            <img className="logo" src={Logo} alt=""/>
            <div className="navbar_login"><NavLink to="/login" style={{ textDecoration: 'none' }}>Sign in</NavLink></div>
            <div className="navbar_registartion"><NavLink to="/registration" style={{ textDecoration: 'none' }}>Sign up</NavLink></div>
        </div>
    )   
}

export default Navbar;
